Object.Field:
    	import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
		import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
        @GeneratorDelegateClass(componentType=DatastoreComponent.COMPONENT_TYPE_NAME, descriptionKey="GeneratorDelegateClass.HiveAppend")
    	public class IKM_Hive_Append extends HiveBaseKM {
    	    // class constructor; initialization is done in setBinding method
    	    public IKM_Hive_Append() {}

            // Declare KM level variables
            protected AbstractSyntaxTree intoTargetAST
            protected AbstractSyntaxTree targetTableAST
            protected boolean option_TRUNCATE                 = false
            protected boolean option_EXTERNAL_TABLE 	      = false;
            protected OdiDataStore sourceDataStore, targetDataStore;
            protected Object serdevalue;
            protected Object inputfvalue;  
            protected Object outFvalue;
            protected Object fileFormat;
            protected Object tblPropvalue;
            protected Object hiveLocation;
            protected Object fieldSep;  
            protected Object recSep;
            protected Object storageRowFormat;
            protected Object escpChar;
            protected Object mapKeytSep;
            protected Object collecSep;
            protected Object nullDefinedAs;

            void setBinding( Binding binding ) {
            	super.setBinding( binding )        	
                option_TRUNCATE                   = isOptionTrue( "TRUNCATE" )

                Object tgtCompBondObj = this.physicalNode.getLogicalComponent().getBoundObject();
                targetDataStore = ((oracle.odi.domain.model.OdiDataStore) tgtCompBondObj).getRealObject()

                List<MapPhysicalNode> upStreamNodes = this.physicalNode.getUpstreamConnectedNodes();
                while (!upStreamNodes.get(0).isSourceNode()){
                  upStreamNodes = upStreamNodes.get(0).getUpstreamConnectedNodes();
                }
                MapPhysicalNode parentNode = upStreamNodes.get(0);
                Object srcCompBondObj = parentNode.getLogicalComponent().getBoundObject();
                sourceDataStore = ((oracle.odi.domain.model.OdiDataStore) srcCompBondObj).getRealObject()

                if (targetDataStore.getHadoopStorageDescriptor() != null) {
                  serdevalue = targetDataStore.getHadoopStorageDescriptor().getSerde(); 
                  inputfvalue = targetDataStore.getHadoopStorageDescriptor().getInputFormat(); 
                  outFvalue = targetDataStore.getHadoopStorageDescriptor().getOutputFormat();   
                  hiveLocation = targetDataStore.getHadoopStorageDescriptor().getHiveLocation();
                  //tblPropvalue = sourceDataStore.getHadoopStorageDescriptor().getSchemaFile();
                  fileFormat = targetDataStore.getHadoopStorageDescriptor().getFormatType();
                  if (!SnpsStringTools.replaceNVL(targetDataStore.getHadoopStorageDescriptor().getFieldSeparator()).trim().equals(""))
                    fieldSep = SnpsStringTools.replaceNVL(SnpsStringTools.escapeUnicode(targetDataStore.getHadoopStorageDescriptor().getFieldSeparator(), false))
                  if (!SnpsStringTools.replaceNVL(targetDataStore.getHadoopStorageDescriptor().getRowSeparator()).trim().equals(""))
                    recSep = SnpsStringTools.replaceNVL(SnpsStringTools.escapeUnicode(SnpsStringTools.hexStrToStr(targetDataStore.getHadoopStorageDescriptor().getRowSeparator()), true))

                  storageRowFormat = targetDataStore.getHadoopStorageDescriptor().getHiveRowFormat();
                  escpChar = targetDataStore.getHadoopStorageDescriptor().getEscapeCharacter();
                  mapKeytSep = targetDataStore.getHadoopStorageDescriptor().getMapKeysSeparator();
                  collecSep = targetDataStore.getHadoopStorageDescriptor().getCollectionSeparator();
                  nullDefinedAs = targetDataStore.getHadoopStorageDescriptor().getNullDefinedAs();
                  option_EXTERNAL_TABLE = !targetDataStore.getHadoopStorageDescriptor().isHiveManaged()
                }
            }

            // Publish any variables back into binding to make them available in templates and variableDefText
            void updateBinding() {
            	super.updateBinding()        	
                mBinding.setVariable( "option_TRUNCATE",      option_TRUNCATE )
                mBinding.setVariable( "intoTargetAST",        intoTargetAST )
                mBinding.setVariable( "targetTableAST",       targetTableAST )        	
            }

	        @ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=HiveInsertStatement.class, styleKey="ProcessingStyleKey.Hive.INSERT")
            AbstractSyntaxTree INSERT( SqlQuery input ) {

                def returnAST
                def templateUtils = input.getTemplateUtils()

                // Create DML for insert into target table
                def targetTable      = getTargetTable()
                def targetColumnList = new ArrayList<Column>();
                def targetSelectList = new ArrayList<ISelectItem>();  
                def targetSelectQuery = getSourceAndTargetExpressionsAndQuery( targetTable, input, targetSelectList, targetColumnList,           
                        { attr -> 
                        	// Is this an unmapped Attribute?
                        	if ( !attr.isMapped() ) {
                        	    // So we have to put a casted NULL
                        	    def hiveColumn = attr.getBoundObject()
                        	    def dataType   = hiveColumn.getDdlDataType()
                        	    return new UnmappedColumnExpression( dataType )
                        	}
                        	// Is this a constant value mapped on target?
                        	if ( !attr.referencesUpstreamAttribute() 
                        	     && (attr.getExecuteOnHint() == MapExpression.ExecuteOnLocation.TARGET)
                        	   ) {
                        	   // So we just insert the verbatim expression text
                        	   return new StringExpression( attr.getExpression().getText(), attr )
                        	}
                        	// Ok, then this must be a mapped source column, which we just copy over
                        	return new CopyColumnExpression()
                        }  )         

                intoTargetAST = new HiveInsertStatement( targetTable, targetColumnList, targetSelectQuery, ffFinder )
                initTargetAST( intoTargetAST )

                def rowFormatClause = ""
                def serde = ""
                def inputformat = ""
                def outputformat = ""
                def fileFormatName = ""
                def tblprop = ""
                def hiveloc = ""

                if ( serdevalue != null) {
                  serde = serdevalue.toString();
                }
                if ( inputfvalue != null) {
                  inputformat = inputfvalue.toString();
                }
                if (fileFormat != null) {
                  fileFormatName = fileFormat.getName().toString();
                }
                if (outFvalue != null) {
                  outputformat = outFvalue.toString();
                }
                if ( tblPropvalue != null) {
                  tblprop = tblPropvalue.toString();
                }
                if ( hiveLocation != null) {
                  hiveloc = hiveLocation.toString();
                }
                if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.DELIMITED) {
                  rowFormatClause  += """ROW FORMAT DELIMITED\n"""
                  rowFormatClause  +=  """FIELDS TERMINATED BY '""" + fieldSep.toString() + """' \n""" 
                  if ( escpChar != null) {rowFormatClause  += """ESCAPED BY '""" + escpChar.toString() + """' \n"""}
                  if (collecSep != null) {rowFormatClause  += """COLLECTION ITEMS TERMINATED BY '""" + collecSep.toString() + """' \n"""}
                  if (  mapKeytSep != null) {rowFormatClause  +=  """MAP KEYS TERMINATED BY '""" + mapKeytSep.toString() + """' \n"""}
                  if ( recSep != null) {rowFormatClause  +=  """LINES TERMINATED BY '""" +  recSep.toString() + """' \n"""} 
                  if ( nullDefinedAs != null) {rowFormatClause  += """NULL DEFINED AS '""" + nullDefinedAs.toString() + """' \n"""} 
                  rowFormatClause  += """STORED AS """ 
                } else if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.SERDE) {  
                  rowFormatClause  = """ROW FORMAT SERDE '""" + serde + """' \n""" + """STORED AS """ 
                } else if (storageRowFormat != null && storageRowFormat == oracle.odi.domain.model.OdiDataStore.HadoopStorageDescriptor.HiveRowFormat.BUILT_IN) {  
                  if("JSON".equalsIgnoreCase(fileFormatName)){
                    rowFormatClause  = """ROW FORMAT SERDE '""" + "org.apache.hive.hcatalog.data.JsonSerDe"  + """' \n""" + """STORED AS """
                  }else {
                    rowFormatClause  = """STORED AS """
                  }                 
                }
                if (inputformat.trim().length() > 0 && outputformat.trim().length() > 0 && "INPUTFORMAT".equalsIgnoreCase(fileFormatName)) {
                  rowFormatClause += """\nINPUTFORMAT '""" + inputformat + """' \n""" +
                                     """OUTPUTFORMAT '""" + outputformat + """' \n""" 
                  if ( option_EXTERNAL_TABLE )
                  	rowFormatClause += """\nLOCATION '""" + hiveloc + """' \n"""
                  if (tblprop.trim().length() > 0 && ("avro".contains(inputformat) || "avro".contains(outputformat)))
                    rowFormatClause += """TBLPROPERTIES ( \n""" + """'avro.schema.url'='""" + tblprop.trim() + """') \n"""                   
                } else if (fileFormatName.trim().length() > 0 && !"JSON".equalsIgnoreCase(fileFormatName)) {
                  rowFormatClause += fileFormatName  + """ \n"""
                  if ( option_EXTERNAL_TABLE )
                  	rowFormatClause += """\nLOCATION '""" + hiveloc + """' \n"""
                  if (tblprop.trim().length() > 0 && "AVRO".equalsIgnoreCase(fileFormatName))
                    rowFormatClause += """TBLPROPERTIES ( \n""" + """'avro.schema.url'='""" + tblprop.trim() + """') \n""" 
                } else {
                  if (storageRowFormat != null)
                    rowFormatClause += """TEXTFILE\n"""
                if ( option_EXTERNAL_TABLE )
                  	rowFormatClause += """\nLOCATION '""" + hiveloc + """' \n"""
                }

                targetTable.external = option_EXTERNAL_TABLE
                targetTable.rowFormatClause = rowFormatClause

                // Create DDL for target
                targetTableAST   = new HiveCreateTableStatement( "abc", "def", targetTable, getHiveTechnology(), ffFinder )
                targetColumnList = physicalNode.getNodeAttributes().collect { attr -> Column.getColumn( targetTable, attr ) }   
                targetTableAST.setColumns( targetColumnList )                

                // Overwrite target data?
                intoTargetAST.overwrite = option_TRUNCATE

                // Publish variables into binding to make them available in templates and variableDefText
                updateBinding()

                //return intoTargetAST
                return intoTargetAST
              }  
          }
